import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

//importar nuestros componentes
import ProductList from './components/ProductList';
import ProductForm from './components/ProductForm';
import ProductDetail from './components/ProductDetail';
import ProductDelete from './components/ProductDelete';

function App() {
    return (
        <Router>
            <Routes>
                <Route exact path="/productos" element={<ProductList />} />
                <Route exact path="/productos/nuevo" element={<ProductForm />} />
                <Route exact path="/productos/:id" element={<ProductDetail />} />
                <Route exact path="/productos/:id/editar" element={<ProductForm />} />
                <Route exact path="/productos/:id/eliminar" element={<ProductDelete />} />
            </Routes>
        </Router>
    );
}

export default App;
